import math

def euklides(bigger, lesser):   # if those numbers are equal their order doesn't matter
    wynik = bigger % lesser
    if wynik == 0:
        return lesser
    else:
        return euklides(lesser, wynik)


def coprime(number1, number2):
    if number1 >= number2:
        if euklides(number1, number2) == 1:
            return True
        else:
            return False
    else:
        if euklides(number2, number1) == 1:
            return True
        else:
            return False

